(1,	'Tribal Flare Choker',	'tribal-flare-choker',	37,	78,	2,	NULL,	'https://res.cloudinary.com/diyc1dizi/image/upload/Aranya_new_products/J0400004MA1116/2.jpg',	'https://res.cloudinary.com/diyc1dizi/image/upload/Aranya_new_products/J0400004MA1116/2.jpg',	NULL,	NULL,	NULL,	NULL,	'18',	'1',	'14',	'cm',	NULL,	99,	'J0400004MA1116',	'',	'Yes',	0.0000,	'<p>Sterling silver coins have been attached to this choker that has been woven delicately with Terracotta, Rudrakha and wooden beads. The colours are relfections of natural dyes of Indigo and Madder.</p>',	1,	0,	0,	'2023-10-19 10:49:24',	NULL,	'2023-11-29 09:50:52'),
(2,	'Pansy Cotton Voil Panjabi',	'pansy-cotton-voil-panjabi',	3,	79,	1,	NULL,	'https://res.cloudinary.com/diyc1dizi/image/upload/Aranya_new_products/K0010352FFS1202719/4_2.jpg',	'https://res.cloudinary.com/diyc1dizi/image/upload/Aranya_new_products/K0010352FFS1202719/4_2.jpg',	'https://res.cloudinary.com/diyc1dizi/image/upload/Aranya_new_products/K0010352FFS1202719/4_1.jpg',	NULL,	NULL,	NULL,	'0',	'0',	'0',	'cm',	NULL,	0,	'K0010352FFS1202719',	'Red',	'No',	0.0000,	'<p>The mesmerizing shades of red complimenting in this panjabi were taken from organically grown madder successively. Block print has been used on cotton voil fabric to ensure the highest amount of easement. All Aranya products are hand made, using natural fibers and materials within a fair trade framework.</p>',	1,	0,	1,	'2023-10-19 10:49:24',	NULL,	'2023-10-22 10:31:16'),
(3,	'Deutzia baby panjabi',	'deutzia-baby-panjabi',	3,	79,	1,	NULL,	'https://res.cloudinary.com/diyc1dizi/image/upload/Aranya_new_products/K0010372NK10194019/5_1.jpg',	'https://res.cloudinary.com/diyc1dizi/image/upload/Aranya_new_products/K0010372NK10194019/5_1.jpg',	'https://res.cloudinary.com/diyc1dizi/image/upload/Aranya_new_products/K0010372NK10194019/5_2.jpg',	'',	'',	'',	'0',	'0 ',	'0 ',	'cm',	NULL,	0,	'K0010372NK10194019',	'Black',	'No',	0.0000,	'Dark designs on a light base and comfortable fabric makes it a perfect traditional wear for your child .All Aranya products are handmade, using natural materials, within a fair trade framework.',	1,	0,	1,	'2023-10-19 10:49:24',	NULL,	'2023-10-19 10:49:24'),
